const UserOutput = () => {
    return (
        <div>
            {this.props.name}
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean mattis nibh et risus porta, nec tristique nisl pharetra. Nullam enim magna, ultrices id elementum sit amet, malesuada a lectus. Morbi tristique, sapien eget convallis vestibulum, eros mi mattis enim, non rhoncus nibh arcu in ante. Aliquam molestie molestie eros nec fermentum. Etiam nec nisl venenatis, faucibus ante at, iaculis diam. Curabitur gravida suscipit sapien nec semper. Suspendisse ac quam ut ipsum molestie bibendum. Sed ac vehicula mauris. Aliquam eu commodo lacus, ac tristique nulla. Sed dolor ex, fringilla eu nisl in, convallis lacinia risus. Cras sed odio aliquam, vestibulum nisi vel, suscipit lacus.</p>
            <p>Donec et tortor vel enim egestas tempor ac sit amet magna. Suspendisse eget tristique tellus. Aliquam metus tellus, efficitur quis tempus quis, tincidunt quis sem. Curabitur quis laoreet massa, malesuada fringilla justo. Fusce sodales risus in ante elementum, quis porta tortor imperdiet. Cras augue magna, laoreet aliquet aliquam ac, finibus at leo. Nunc rhoncus sed risus id ultrices. Donec maximus, mi at congue mattis, lectus est aliquet purus, sed sodales libero nisl sed augue. Suspendisse finibus vehicula ipsum, quis lacinia dolor vulputate et.</p>
        </div>
    )
};

export default UserOutput;
